import React from 'react';
import './NewPage.css';

const NewPage = () => {
  const dots = [
    { x: 120, y: 50 }, // Adjusted values to move dots to the top
    { x: 160, y: 100 },
    { x: 200, y: 150 }
  ];

  return (
    <div className="new-page-container">
      <h1>New Page</h1>
      <p>Here are some dots on the image:</p>
      <div className="image-container">
        <img
          src={`${process.env.PUBLIC_URL}/zikir/Vector.png`}
          alt="Vector"
          className="clickable-image"
          style={{ transform: 'rotate(180deg)' }} // Rotate the image
        />
        {dots.map((dot, index) => (
          <img
            key={index}
            src={`${process.env.PUBLIC_URL}/zikir/nokta.png`}
            alt="Dot"
            className="dot"
            style={{ left: `${dot.x}px`, top: `${dot.y}px` }}
          />
        ))}
      </div>
    </div>
  );
};

export default NewPage;
